Article = new Meteor.Collection("Articles");

//Defining a new schema named "Article Schema"
ArticleSchema = new SimpleSchema({
  name: {
    type: String,
    label: "article name"
  },

  category:{
    type: String,
    label: "article category"
  },

  createdAt: {
    type: Date,
    label: "Created At",
    autoValue: function(){
      return new Date()
    }
  }
});

Article.attachSchema(ArticleSchema);
